import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Dashboard from './JS/Dashboard';
import HomePage from './JS/HomePage';
import AccountPage from './JS/AccountPage';
import AccidentReport from './JS/AccidentReport';
import ArticlesPage from './JS/ArticlesPage';
import PolicyPage from './JS/PolicyPage';
import AboutPage from './JS/AboutPage';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/dashboard" element={<Dashboard />} />
        <Route path="/account" element={<AccountPage />} />
        <Route path="/report-accident" element={<AccidentReport />} />
        <Route path="/articles" element={<ArticlesPage />} />
        <Route path="/policy" element={<PolicyPage />} />
        <Route path="/about" element={<AboutPage />} />
      </Routes>
    </Router>
  );

}

export default App;
